import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { BrowserRouter } from "react-router-dom";
import { provider } from "react-redux";

ReactDOM.render(
  <React.StrictMode>
    <provider>
      <BrowserRouter>
        <App />
      </BrowserRouter>
    </provider>
  </React.StrictMode>,

  document.getElementById("root")
);
